-- Table: customers
CREATE TABLE customers (id TEXT, name TEXT, business_name TEXT, city TEXT, registered_at TEXT);


-- Table: suppliers
CREATE TABLE suppliers (id TEXT, name TEXT, category TEXT, location TEXT);


-- Table: products
CREATE TABLE products (id TEXT, name TEXT, category TEXT, unit_price TEXT);


-- Table: supplier_products
CREATE TABLE supplier_products (id TEXT, supplier_id TEXT, product_id TEXT, stock_quantity TEXT);


-- Table: orders
CREATE TABLE orders (id TEXT, customer_id TEXT, order_date TEXT, status TEXT, total_amount TEXT);


-- Table: order_items
CREATE TABLE order_items (id TEXT, order_id TEXT, product_id TEXT, quantity TEXT, unit_price TEXT);


-- Table: warehouses
CREATE TABLE warehouses (id TEXT, name TEXT, city TEXT, capacity TEXT);


-- Table: shipments
CREATE TABLE shipments (id TEXT, order_id TEXT, warehouse_id TEXT, shipped_at TEXT, delivered_at TEXT, status TEXT);


-- Table: delivery_partners
CREATE TABLE delivery_partners (id TEXT, name TEXT, vehicle_type TEXT, phone_number TEXT);


-- Table: delivery_assignments
CREATE TABLE delivery_assignments (id TEXT, shipment_id TEXT, partner_id TEXT, assigned_at TEXT, completed_at TEXT);


-- Table: product_reviews
CREATE TABLE product_reviews (id TEXT, customer_id TEXT, product_id TEXT, rating TEXT, comment TEXT, reviewed_at TEXT);

